import React from "react";
import ReactDOM from "react-dom";
import Sdata from "./Div";
import Card from "./App"
//import "./index.css";



function Newarr(){
         return  <>
        <Card key={Sdata[1].id}
         imgsrc={Sdata[1].imgscr}
         title={Sdata[1].title}
         sname={Sdata[1].sname}
         link={Sdata[1].link}
/></>

  } 


  ReactDOM.render(
    <>
    
    
    <Newarr />
    </>,
  document.getElementById("root") 
  );
